Richard Reti, &quot;Modern Ideas in Chess&quot;
ISBN: 1888690623 | 2009 | EPUB/MOBI | 144 pages | 6 MB/6 MB

Richard Reti was a formidable over the board grandmaster as shown by his victories at the splendid tournaments of Kaschau 1918, Gothenburg 1920 and Teplitz Schonau 1922. His victims included Capablanca, Alekhine and Nimzowitsch, while his elegant destruction of Bogolyubow deservedly won the beauty prize at New York 1924.
